con:config.script:
import com.eviware.soapui.support.GroovyUtils

//To get testcase name
def testCaseName = context.getTestCase().name
log.info ("Testcase name is " + testCaseName)

//to get testsuite name
def testSuiteName = context.getTestCase().getTestSuite().name
log.info ("TestSuite name is " + testSuiteName)

//to run the Create Product with Product element
testRunner.testCase.testSuite.project.testSuites["TestSuite2Groovy"].testCases["TestCase 1"].testSteps["CreateProduct"].run(testRunner,context)

//get the data of new proudct created in XML
def resXml = context.expand('${CreateProduct#request}')
log.info ("Request is " + resXml)

def groovyUtils = new GroovyUtils(context)

def resXmlholdr = groovyUtils.getXmlHolder(resXml)
out = resXmlholdr.getNodeValue("//sku")

log.info("Sku code created is  " + out)


def reqXml = context.expand('${SOAPGetSku#request}')
log.info ("Request is " + reqXml)

//to parse the xml
xmlholdr = groovyUtils.getXmlHolder(reqXml)

//to update the request using xpath
xmlholdr.setNodeValue("//sku",out)

//to store the updated xml
def updatedXml = xmlholdr.getXml();
log.info ("Updated Xml is " + updatedXml)

//to pass the xml to testrunner
testRunner.testCase.getTestStepByName("SOAPGetSku").setPropertyValue("request", updatedXml)

//to run the teststep of GetSKUProdct
testRunner.testCase.testSuite.project.testSuites["TestSuite2Groovy"].testCases["TestCase 1"].testSteps["SOAPGetSku"].run(testRunner,context)

