con:config.script:
import com.eviware.soapui.support.GroovyUtils

def groovyUtils = new GroovyUtils(context)

def reqXml = context.expand('${GetBySKUReq#request}')
log.info ("Request is " + reqXml)

//toget tne value from properties and store in a varaiable
def ProdID = testRunner.testCase.getPropertyValue("ProudctCode")
log.info ("Code to enter is  " + ProdID)


//to parse the xml
xmlholdr = groovyUtils.getXmlHolder(reqXml)

//to update the request using xpath
//xmlholdr.setNodeValue("//sku","SKU00001")
xmlholdr.setNodeValue("//sku",ProdID)

//to store the updated xml
def updatedXml = xmlholdr.getXml();
log.info ("Updated Xml is " + updatedXml)

//to pass the xml to testrunner
testRunner.testCase.getTestStepByName("GetBySKUReq").setPropertyValue("request", updatedXml)

//to run the teststep of GetSKUProdct
testRunner.testCase.testSuite.project.testSuites["TestSuite2Groovy"].testCases["TestCase 2"].testSteps["GetBySKUReq"].run(testRunner,context)


//To fetch the response
def resp = context.expand('${GetBySKUReq#response}')
log.info ("Response is " + resp)

//To parse the response xml
def resXmlholdr = groovyUtils.getXmlHolder(resp)

//To get the SKU code from the response
def SkuOPt = resXmlholdr.getNodeValue("//result/sku")
log.info ("sku code is " + SkuOPt)

//to store the country code in properties
testRunner.testCase.getTestStepByName("Properties").setPropertyValue("skuTobeDeleted", SkuOPt)

//to run the delete req 
testRunner.testCase.testSuite.project.testSuites["TestSuite2Groovy"].testCases["TestCase 2"].testSteps["DeleteBySKU"].run(testRunner,context)
